// JavaScript Document

import React, { useState, useEffect } from 'react';


function FetchContent() {


	const [posts, setPosts] = useState([]);

	useEffect(() => {
		fetch("https://dev.justinblayney.com/wp-json/wp/v2/posts/2797")
		.then(res => res.json())

		.then(json =>
			 setPosts(json)
			  )

		.then(json => console.log(json))
		 });


	return (
	<>
		{posts.map(post => (
         <div key={post.id}>

		<h1>{post.title.rendered}</h1>

		{post.content.rendered}

		</div>
        ))}

	</>

	);


}


function Page() {
  return (
    <div className="container-fluid">

	<FetchContent />

    </div>
  );
}

export default Page;
